import {
    Layout,
    Page,
    Button
} from '@shopify/polaris';

class Login extends React.Component {
    render(){
        return (
            <Page>
                <Layout>
                    <Button url="/"></Button>
                    Dashboard page
                </Layout>
            </Page>
        );
    }
}

export default Login;
